import React from "react";
import "./skill.css";
import javaScript from "../../assets/images/JS.svg";

import html from "../../assets/images/html5.png";

const Skills = () => {
  return (
    <section id="skills">
      <span className="skillTitle"> My Skills </span>
      <span className="skillDesc">
        I'm all about bringing ideas to life, whether through design or code.
        Check out some of the skills I've picked up along the way.
      </span>

      <div className="skillBars">
        <div className="skillBar">
          <div className="skillBarText">
            <img src={javaScript} alt="Language" className="skillBarImg" />
            <img src={html} alt="Language" className="skillBarImg" />
          </div>
        </div>
      </div>
    </section>
  );
};
export default Skills;
